import React from 'react'

import './Popup.css'

const Popup = props => {

  return (
    <div className="popup">
      <div className="fundoPopup">
        <div className="areaPopup">
          <h2>Agenda de Eventos</h2>
          <span className="fecharPopup" onClick={props.fecharPopup}>X</span>
          {props.children}
        </div>
      </div>
    </div>  
  )
}
export default Popup
